(1, 1, '2014-12-01 20:29:00', '2014-12-01 20:29:00', 'Welcome to WordPress. This is your first post. Edit or delete it, then start blogging!', 'Hello world!', '', 'publish', 'open', 'open', '', 'hello-world', '', '', '2014-12-01 20:29:00', '2014-12-01 20:29:00', '', 0, 'http://localhost/archersocial/?p=1', 0, 'post', '', 1),
(2, 1, '2014-12-01 20:29:00', '2014-12-01 20:29:00', 'This is an example page. It''s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\r\n\r\n<blockquote>Hi there! I''m a bike messenger by day, aspiring actor by night, and this is my blog. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin'' caught in the rain.)</blockquote>\r\n\r\n...or something like this:\r\n\r\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\r\n\r\nAs a new WordPress user, you should go to <a href="http://localhost/archersocial/wp-admin/">your dashboard</a> to delete this page and create new pages for your content. Have fun!', 'Sample Page', '', 'publish', 'open', 'open', '', 'sample-page', '', '', '2014-12-01 20:29:00', '2014-12-01 20:29:00', '', 0, 'http://localhost/archersocial/?page_id=2', 0, 'page', '', 0),
(3, 1, '2014-12-01 20:29:08', '0000-00-00 00:00:00', '', 'Auto Draft', '', 'auto-draft', 'open', 'open', '', '', '', '', '2014-12-01 20:29:08', '0000-00-00 00:00:00', '', 0, 'http://localhost/archersocial/?p=3', 0, 'post', '', 0),
(4, 1, '2014-12-01 20:29:28', '2014-12-01 20:29:28', '', 'Activity', '', 'publish', 'closed', 'closed', '', 'activity', '', '', '2014-12-01 20:29:28', '2014-12-01 20:29:28', '', 0, 'http://localhost/archersocial/?page_id=4', 0, 'page', '', 0),
(5, 1, '2014-12-01 20:29:28', '2014-12-01 20:29:28', '', 'Members', '', 'publish', 'closed', 'closed', '', 'members', '', '', '2014-12-01 20:29:28', '2014-12-01 20:29:28', '', 0, 'http://localhost/archersocial/?page_id=5', 0, 'page', '', 0),
(6, 1, '2015-02-27 13:32:52', '2015-02-27 13:32:52', '<iframe style="border: 0;" src="//justinandco.com/helpnotewelcome/" width="100%" height="1000"></iframe>', 'Welcome to Help Notes', '', 'publish', 'open', 'open', '', 'welcome-to-help-notes', '', '', '2015-02-27 13:32:52', '2015-02-27 13:32:52', '', 0, 'http://localhost/archersocial/?page_id=6', 0, 'page', '', 0);
